    'a','b','c','d','e','f','g','h','i','j','k','l','m',
    'n','o','p','q','r','s','t','u','v','w','x','y','z'
};

template<typename ForwardIt, typename F>
bool cartesian_product_repeat(ForwardIt first, ForwardIt last, i64 n, F f) {
    using T = typename iterator_traits<ForwardIt>::value_type;

    auto rec = FIX([first,last,n,f](auto&& self, vector<T>& v) -> bool {
        if(SIZE(v) == n)
            return f(const_cast<const vector<T>&>(v));

        for(auto it = first; it != last; ++it) {
            v.emplace_back(*it);
            if(self(v)) return true;
            v.pop_back();
        }
        return false;
    });

    vector<T> v;
    return rec(v);
}

void solve() {
    i64 N; RD(N);

    unordered_set<string> ss;
    REP(_, N) {
        string s; RD(s);
        FOR(len, 1, 5) REP(i, SIZE(s)-len+1) {
            ss.emplace(s.substr(i,len));
        }
    }

    FOR(len, 1, 5) {
        string ans;
        bool ok = ALL(cartesian_product_repeat, CHARS_LOWER, len,
                      [&ss,&ans](const vector<char>& v) -> bool {
            string s(begin(v), end(v));
            if(ss.find(s) != end(ss)) return false;
            ans = move(s);
            return true;
        });
        if(ok) {
            PRINTLN(ans);
            return;
        }
    }
    assert(false);
}

