typedef long long ull;
ull B = 9973LL;
ull mod1 = 1000000007LL;
ull mod2 = 999999937LL;

vector<string> S;
vector< vector<ull> > H1;
vector< vector<ull> > H2;
vector<int> v(400000, -1);

int main() {
  int N;
  cin >> N;
  int mxsz = 0;
  for(int i = 0; i < N; i++) {
    string s;
    cin >> s;
    mxsz = max(mxsz, (int)s.size());
    vector<ull> h1(s.size()+1, 0);
    vector<ull> h2(s.size()+1, 0);
    for(int j = 0; j < s.size(); j++) {
      h1[j+1] = (h1[j] + s[j]) * B % mod1;
      h2[j+1] = (h2[j] + s[j]) * B % mod2;
    }
    H1.push_back(h1);
    H2.push_back(h2);
    S.push_back(s);
  }
  vector<int> B1(mxsz+1);
  vector<int> B2(mxsz+1);
  B1[0] = 1;
  B2[0] = 1;
  for(int i = 0; i < mxsz; i++) {
    B1[i+1] = B1[i] * B % mod1;
    B2[i+1] = B2[i] * B % mod2;
  }
  string ans = "";
  for(int i = 0; ; i++) {
    bool carry = true;
    for(int i = 0; carry; i++) {
      carry = false;
      v[i]++;
      if(v[i] == 26) v[i] = 0, carry = true;
    }
    ans = "";
    for(int i = 0; v[i] != -1; i++) ans += 'a'+v[i];
    reverse(ans.begin(), ans.end());
    ull hv1 = 0LL, hv2 = 0LL;
    for(int i = 0; i < ans.size(); i++) {
      hv1 = (hv1 + ans[i]) * B % mod1;
      hv2 = (hv2 + ans[i]) * B % mod2;
    }
    bool flag = true;
    for(int j = 0; j < N && flag; j++) {
      if(S[j].size() < ans.size()) continue;
      for(int k = 0; k+ans.size() <= S[j].size(); k++) {
	if(((H1[j][k+ans.size()]-H1[j][k] * B1[ans.size()]) % mod1 + mod1) % mod1 == hv1 &&
	   ((H2[j][k+ans.size()]-H2[j][k] * B2[ans.size()]) % mod2 + mod2) % mod2 == hv2 &&
	   ans == S[j].substr(k, ans.size())) {
	  flag = false;
	  break;
	}
      }
    }
    if(flag) {
      cout << ans << endl;
      return 0;
    }
  }


  return 0;
}

