int main(void){
	scanf("%d",&n);
	for(int i=0;i<n;i++){
		cin >> str[i];
	}
	cal[0]=1;
	for(int i=1;i<5;i++){
		cal[i]=cal[i-1]*26;
	}
	int len=1;
	while(1){
		memset(flag,false,sizeof(flag));
		for(int i=0;i<n;i++){
			int hash=0;
			if(str[i].size()<len)continue;
			for(int j=0;j<len;j++){
				hash=hash*26+(str[i][j]-'a');
			}
			flag[hash]=true;
			for(int j=len;j<str[i].size();j++){
				hash-=(str[i][j-len]-'a')*cal[len-1];
				hash=hash*26+(str[i][j]-'a');
				flag[hash]=true;
			}
		}
		for(int i=0;i<cal[len];i++){
			if(!flag[i]){
				string res="";
				int g=i;
				for(int j=0;j<len;j++){
					res+='a'+(g/cal[len-j-1]);
					g%=cal[len-j-1];
				}
				cout << res << endl;
				return 0;
			}
		}
		len++;
	}
	return 0;
}

