      }
    }
  }
  vector<int> vec(5, -1);
  while(1) {
    bool carry = true;
    for(int i = 0; carry; i++) {
      carry = false;
      vec[i]++;
      if(vec[i] >= 26) {
	vec[i] = 0;
	carry = true;
      }
