    string ans = "";
    for(int i = 0; vec[i] != -1; i++) ans += 'a' + vec[i];
    reverse(ans.begin(), ans.end());
    if(st.count(ans)) continue;
    else {
      cout << ans << endl;
      return 0;
    }
  }

  return 0;
}

