#define MAX_L 8
#define MAX_N 100005
typedef long long ll;
ll mod=1e9+7;
ll B=5575777;

int N;
string S[MAX_N];
set<ll> t[MAX_L+1];
char tmp[MAX_L+5];

bool dfs(ll hash,int depth,int anslen){
  if(depth==anslen){
    if(t[anslen].count(hash)==1)return false;
    for(int i=0;i<depth;i++)cout<<tmp[i];
    cout<<endl;
    return true;
  }

  for(char ch='a';ch<='z';ch++){
    tmp[depth]=ch;
    ll nhash=(hash*B+ch)%mod;
    if( dfs(nhash,depth+1,anslen) )return true;
  }
  return false;
}

void solve(){
  for(int i=0;i<N;i++){
    int size=S[i].size();

    for(int j=1;j<=MAX_L;j++){

      ll key=0,nb=1;
      for(int k=0;k<size;k++){
        key=(key*B+S[i][k])%mod;
        if(k-j>=0){
          key+=(mod- (S[i][k-j]*nb)%mod );
          key%=mod;
        }else nb=(nb*B)%mod;
        if(k+1>=j)t[j].insert(key);
      }

    }
  }

  ll cnt=1;
  int anslen=1;
  for(int i=1;i<=MAX_L;i++){
    cnt*=26;
    if( (ll)t[i].size() < cnt ){
      anslen=i;
      break;
    }
  }

  dfs(0,0,anslen);
}

