void mkpass(int i,int l,char *pas){
	for(int j = 0;j < l;j++){
		int si = 1;
		for(int k = 0; k< l-(j+1);k++) si *= 26;
		if(j == l -1) pas[j] = al[i%26];
		else pas[j] = al[i/si%26];
	}
	pas[l] = '\0';
}

