int min;
std::string res;

void dfs(int depth, std::string s,
           const std::set<std::string> &st)
{
    if (depth == 4) {
        if (s.empty() || st.count(s)) {
            return;
        }

        int size = s.size();
        if (size < min) {
            min = size;
            res = s;
        } else if (size == min) {
            res = std::min(res, s);
        }
        return;
    }

    dfs(depth + 1, s, st);    
    for (char c = 'a'; c <= 'z'; c++) {
        dfs(depth + 1, s + c, st);
    }    
}

