int encode(string s) {
	int ret = 0;
	int mul = 1;

	for (int i = 0; i < s.length(); i++) {
		ret += (s[i] - 'a') * mul;
		mul *= 26;
	}
	return ret;
}

string decode(int id, int length) {
	string ret;
	int mul = 1;

	for (int i = 0; i < length; i++) {
		int val = (id / mul) % 26;
		ret += (char)(val + 'a');
		mul *= 26;
	}
	return ret;
}

