int encode(string s) {
	int ret = 0;
	int mul = 1;

	for (int i = (int)s.length() - 1; i >= 0; i--) {
		ret += (s[i] - 'a') * mul;
		mul *= 26;
	}
	return ret;
}

string decode(int id, int length) {
	string str;
	int mul = 1;

	for (int i = length - 1; i >= 0; i--) {
		int val = (id / mul) % 26;
		str += (char)(val + 'a');
		mul *= 26;
	}

	string ret;
	for (int i = length - 1; i >= 0; i--) {
		ret += str[i];
	}

	return ret;
}

