		}
		vector<int>tmp(n + 1);
		for (int k = 1; k <= n; k *= 2) {
			auto comp = [&](int i, int j) {
				if (rank[i] != rank[j])
					return rank[i] < rank[j];
				else {
					int ri = i + k <= n ? rank[i + k] : -1;
					int rj = j + k <= n ? rank[j + k] : -1;
