			if (h > 0)--h;
			for (; j + h < n&&i + h < n; ++h)
				if (str[j + h] != str[i + h])break;
			lcp[rank[i] - 1] = h;
		}
	}
	//?????????T??\??????????°??????\?°??????????????????????????????????
	int lower_bound(const string& T) {
