vector<string> mkpass(int l){

	vector<string> tespass;
	for(int i = 0; i < po[l]; i++){
		char p[5];
		int j = 0;
		for(j = 0;j < l;j ++){
			if(j == l - 1) p[j] = 'a' + i%26;
			else p[j] = 'a' + i / po[l - j -1] % 26;
		}
		p[j] = '\0';
		tespass.push_back(p);
