    trie* next[26];
    trie(){
        fill(next,next+26,(trie*)0);
    }
    void insert(const string &str){
        insert(str,0);
    }
    bool find(const string &str){
        return find(str,0);
    }
    void insert(const string &str,const int idx){
        if(idx==str.size()) return;
        if(this->next[str[idx]-'a']==NULL) this->next[str[idx]-'a']=new trie();
        this->next[str[idx]-'a']->insert(str,idx+1);
    }
    bool find(const string &str,const int idx){
        if(idx==str.size()) return true;
        if(this->next[str[idx]-'a']==NULL) return false;
        return this->next[str[idx]-'a']->find(str,idx+1);
    }
};

