      if (s.find("|") != string::npos)
        continue;
      substrs.insert(s);
    }
  }

  string t;
  rep(i, 27) rep(j, 27) rep(k, 27) rep(l, 26) {
    t = "";
    if (i) t += 'a' + i - 1;
    if (j) t += 'a' + j - 1;
    if (k) t += 'a' + k - 1;
    t += 'a' + l;
    if (!substrs.count(t)) {
      cout << t << endl;
      return 0;
    }
  }
  return 0; 
}

