struct Trie{
    struct node {
      char c;
      node* v[26];
      node* p;
      node(node* p,char c):p(p),c(c){
        for(int i=0;i<26;i++) v[i] = NULL;
      }
      node(){
        for(int i=0;i<26;i++) v[i] = NULL;
        p = NULL;
      }
    };

    Trie() {
      root = new node();
    };

    node* root;
    void add( const string& s, int id, node* p ){
      if( id == s.size() ) return;
      int to = s[id]-'a';
      if( p->v[to] == NULL ) {
        p->v[to] = new node(p,s[id]);
      }
      add( s, id+1, p->v[to] );
    }
    void add( const string& s ){
      add( s, 0, root );
    }


    string solve(){
      queue<node*> q;
      q.push( root );
      while( !q.empty() ){
        node* p = q.front(); q.pop();
        int sc = -1;
        for(int i=0;i<26;i++)
          if( p->v[i] == NULL ) { sc = i; break; }
        if( sc != -1 ){
          string ans = ""; ans += (char)(sc+'a');
          while( p != root ){
            ans += p->c;
            p = p->p;
          }
          reverse( ans.begin(), ans.end() );
          return ans;
        } else {
          for(int i=0;i<26;i++)
            q.push( p->v[i] );
        }
      }

    }

};

