  for(int i=0;i<N;i++){
    int size=S[i].size();

    for(int j=1;j<=MAX_L;j++){

      ll key=0,nb=1;
      for(int k=0;k<size;k++){
        key=(key*B+S[i][k])%mod;
        if(k-j>=0){
          key+=(mod- (S[i][k-j]*nb)%mod );
          key%=mod;
