struct Trie {
    int root;
    vector<Tnode> node;
    char fr, to;

    Trie(char fr = 'a', char to = 'z')
        :root(0), fr(fr), to(to)
    {
        node.push_back(Tnode(fr, to));
    }

    void add(const string &s) {
        int now = root;
        for (auto c : s) {
            c -= fr;
            if (node[now].nx[c] == -1) {
                node[now].nx[c] = node.size();
                node.push_back(Tnode(fr, to));
            }
            now = node[now].nx[c];
        }
        node[now].exist = true;
    }

    int match(const string &s) {
        int now = root;
        for (auto c : s) {
            c -= fr;
            if (node[now].nx[c] == -1) return 0;
            now = node[now].nx[c];
        }
        return node[now].exist;
    }
};

