            if (hs.Count() == (int)Pow(26, i)) continue;
            else
            {
                if (i == 1) ans = getAns1(hs, d2);
                else if (i == 2) ans = getAns2(hs, d2);
                else if (i == 3) ans = getAns3(hs, d2);
                else ans = getAns4(hs, d2);
                break;
            }
        }
        Console.WriteLine(ans);
    }
    static string getAns4(HashSet<int> hs, Dictionary<int, string> d2)
    {
        for (int i = 1; i <= 26; i++)
            for (int j = 1; j <= 26; j++)
                for (int k = 1; k <= 26; k++)
                    for (int L = 1; L <= 26; L++)
                        if (hs.Add(i * 1000000 + j * 10000 + k * 100 + L)) return d2[i] + d2[j] + d2[k] + d2[L];
        return "";
    }
    static string getAns3(HashSet<int> hs, Dictionary<int, string> d2)
    {
        for (int i = 1; i <= 26; i++)
            for (int j = 1; j <= 26; j++)
                for (int k = 1; k <= 26; k++)
                    if (hs.Add(i * 10000 + j * 100 + k)) return d2[i] + d2[j] + d2[k];
        return "";
    }
    static string getAns2(HashSet<int> hs, Dictionary<int, string> d2)
    {
        for (int i = 1; i <= 26; i++)
            for (int j = 1; j <= 26; j++)
                if (hs.Add(i * 100 + j)) return d2[i] + d2[j];
        return "";
    }
    static string getAns1(HashSet<int> hs, Dictionary<int, string> d2)
    {
        for (int i = 1; i <= 26; i++)
            if (hs.Add(i)) return d2[i];
        return "";
    }
    static HashSet<int> getP(string[] a, Dictionary<string, int> d, int k)
    {
        var hs = new HashSet<int>();
        foreach (var x in a)
            for (int i = 0; i <= x.Length - k; i++)
            {
                var w = x.Substring(i, k);
                var t = 0;
                for (int j = 0; j < k; j++)
                    t += d[w.Substring(j, 1)] * (int)Pow(10, (k - j - 1) * 2);
                hs.Add(t);
            }
        return hs;
    }
}

