class RollingHash:
    def __init__(self, s, base, mod):
        self.s = s
        self.length = length = len(s)
        self.base = base
        self.mod = mod
        self.h = h = [0] * (length + 1)
        for i in range(length):
            h[i + 1] = (h[i] * base + ord(s[i])) % mod
        self.p = p = [1] * (length + 1)
        for i in range(length):
            p[i + 1] = pow(base, i + 1, mod)

    def get(self, l, r):
        mod = self.mod
        return ((self.h[r] - self.h[l] * self.p[r - l]) + mod) % mod


def solve():
    N = int(input())
    hash_list = []
    for _ in range(N):
        s = input()
        h1 = RollingHash(s, 103, MOD)
        hash_list.append((len(s), h1))

    ss = 'abcdefghijklmnopqrstuvwxyz'
    hash_set = set()
    for i in range(4 * 10 ** 5):
        for length, h1 in hash_list:
            for l in range(length - i):
                v1 = h1.get(l, l + i + 1)
                if v1 not in hash_set:
                    hash_set.add(v1)

        for s in itertools.product(ss, repeat=i + 1):
            v1 = RollingHash(s, 103, MOD).get(0, len(s))
            if v1 not in hash_set:
                return ''.join(s)

    return -1


